import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { FormBuilder } from '@angular/forms';
import { Router } from "@angular/router";


@Component({
  selector: 'admin-panel',
  templateUrl: './admin-panel.html',
  styleUrls: ['./admin-panel.css']
})
export class AdminPanelComponent implements OnInit {

  public static Url: string = 'https://localhost:7080/User/';

  constructor(private http: HttpClient, private router: Router) {
    categoryNAME: String;
  }

  ngOnInit() {
    this.http.post<any>('https://localhost:7080/Category', { title: 'Category' }).subscribe(data => {
      this.categoryNAME = data.id;



    var session = sessionStorage.getItem('logged');
    if (session != 'true') {
      alert("You need to Log in to use this page!");
      this.router.navigate(['/login-page']);
    }
  }

  onClickSubmit() {
    alert('teste');
  }
}
<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8" />
  <title></title>
</head>

<body>
  <div class="categoryBox">
    <form #categoryId="ngForm" (ngSubmit)="onClickSubmit()">
      <input type="text" name="category" placeholder="Category" ngModel>
      <button type="submit">Register</button>
    </form>
  </div>
  <h1>Bem vindo ao painel de administrador</h1>

</body>


</html>
